# ## Github workflow
# 3. 8 Steps to Contribute to Someone Else’s Project
#     - Fork the Repository – Create your own copy of the project in your GitHub/GitLab account​
#     - Clone the Fork – Download the forked repository to your local machine using git clone <repository-url>​
#     - Create a Feature Branch – Work on your contributions in a separate branch using git checkout -b feature-branch​
#     - Make and Commit Changes – Implement your changes and commit them with meaningful messages using git commit -m "Descriptive message"​
#     - Push the Changes – Push your changes to your forked repository using git push origin feature-branch​
#     - Open a Pull Request (PR) – Create a PR to propose your changes to the original repository​
#     - Engage in Discussion – Address comments and requested changes by maintainers​
#     - Merge and Sync – Once your PR is merged, update your local repository with git fetch origin and git merge origin/master​
#
#     3.1. Use keywords in PR description or commit message: Fixes #123, Closes #123, Resolves #123. The issue is closed when the PR is merged.
